package main

import (
	"fmt"
	"strconv"
	"strings"
)

func main() {
	word := ""
	fmt.Println(numDifferentIntegers(word))
}

func numDifferentIntegers(word string) int {
	m, flag, tmp := make(map[int]int), false, ""
	for _, i := range strings.Split(word, "") {
		_, e := strconv.Atoi(i)
		if e == nil {
			fmt.Println(i)
			tmp += i
			if !flag {
				flag = true
			}
		}
		if e != nil && flag {
			t, _ := strconv.Atoi(tmp)
			m[t] += 1
			tmp, flag = "", false
		}
		fmt.Println(i, m, tmp)
	}
	if tmp != "" && flag {
		t, _ := strconv.Atoi(tmp)
		m[t] += 1
	}
	ans := 0
	for _, _ = range m {
		ans += 1
	}
	fmt.Println(ans)
	return len(m)
}
